@konaskatenight is the vybe what happens every Friday 5:30-8:45 
🤩 this place is heaven on earth. 
What an honor to serve the Lord in this way. ❤️🙏

Habari ya asubuhi
@gayle_jadraque and I Went to Kenya and it was amazing. We handed out water filters and went to help out a school.
I pondered on the water filter how it would make any dirty water drinkable. Water is essential to us. The filter would catch anything that would harm our bodies. In the same way we all have dirty waters in our lives spiritually  the ultimate water filter is Christ Jesus Himself. He is the only One that has the ability to clean our waters eternally and satisfy our thirst. I want to encourage you to clear your waters and come to Him who can satisfy your thirst 4ever. If you have not come to Christ and cleared your waters. Easy as 123 repent and say sorry and live a new way through Jesus. His blood 🩸 is much stronger than ur short comings. DONT BELIEVE THE LIE YOU ARE TOO FAR OFF. Come home 🏡 👍🔥
